import React, {Component, Fragment} from 'react';


class OptionCTA extends Component {

    constructor(props){
        super(props);
        this.state={
            ctaNum : ''
        }
    }

    addingCta(e){
        e.preventDefault();
       this.setState({
        ctaNum : 'add'
       })
    }
    removingCta(e){
        e.preventDefault();
       this.setState({
        ctaNum : 'remove'
       })
    }

render(){
    return(
        <Fragment>
            <div className="addCta">
                <button onClick={this.addingCta.bind(this)}>add cta</button>
                <button onClick={this.removingCta.bind(this)}>remove cta</button>
            </div>
        </Fragment>
    );
};

};

export default OptionCTA;
